  const [squares, setSequares] = useState(Array(9).fill("Q"));
  return (
    <>
      <div className="board-row">
        <Square value={squares[0]}/>
        <Square value="2"/>
        <Square value="3"/>
        {/*positional arguments only for React*/}
      </div>

      <div className="board-row">
        <Square value="4"/>
        <Square value="5"/>
        <Square value="6"/>
      </div>      

      <div className="board-row">
        <Square value="7"/>
        <Square value="8"/>
        <Square value="9"/>
      </div>
    </>
  );
}

